from itertools import cycle
from screeninfo import get_monitors
from tkinter import *
from tkinter import ttk
import tkinter as tk
import unicodedata
import random
import pygame.mixer
import io
import base64
import time


# Gera um efeito visual de troca de título sincronizado com a transição da abertura para a tela inicial
class TituloAnimado:
    def __init__(self, root, titles, interval=500):
        self.root = root
        self.titles = titles
        self.interval = interval
        self.update_title()

    def update_title(self):
        if self.titles:
            title = self.titles.pop(0)
            self.root.title(title)
            self.root.after(self.interval, self.update_title)


# Classe responsável pela manipulação dos arquivos dos temas e pela lógica do jogo
class Jogo:
    def __init__(self, root):
        self.root = root
        titles = ['.: Welcome to the Jungle :.', 'Jogo da Forca']
        animated_title = TituloAnimado(root, titles, interval=3700)

        # Obtém informações da tela usando a biblioteca "screeninfo"
        screen = get_monitors()[0]

        # Calcula as coordenadas x e y para posicionar a janela no centro da tela
        x = (screen.width - 320) // 2
        y = (screen.height - 400) // 2
        self.root.geometry(f"400x320+{x}+{y}")
        self.root.resizable(False, False)

        # Temas que serão selecionáveis por meio do OptionMenu
        self.temas = ['Adjetivos', 'Alimentos',
                      'Animais', 'Objetos', 'Profissões']
        self.tema_selecionado = StringVar()
        self.tema_selecionado.set(self.temas[0])
        self.reproduzir_musica()
        self.tela_boasvindas()

    def reproduzir_musica(self):
        pygame.mixer.init()
        # Música em MIDI, para compensar o tamanho excessivo da tela de abertura que vem logo abaixo XD
        musica_base64 = ""
        musica_bytes = base64.b64decode(musica_base64)
        musica_file = io.BytesIO(musica_bytes)
        pygame.mixer.music.load(musica_file)
        pygame.mixer.music.set_volume(0.8)
        pygame.mixer.music.play(loops=-1)

    def tela_boasvindas(self):
        # Firula artística que introduz uma temática digna da essência do jogo
        imagem_base64 = ""
        imagem_bytes = base64.b64decode(imagem_base64)
        self.background_image = tk.PhotoImage(data=imagem_bytes)
        self.background_label = tk.Label(
            self.root, image=self.background_image)
        self.background_label.place(x=0, y=0, relwidth=1, relheight=1)
        self.root.after(3600, self.trocar_tela)
        self.root.mainloop()

    def trocar_tela(self):
        self.tela_apresentacao()

    def tela_apresentacao(self):
        self.background_label.destroy()
        self.frame = Frame(self.root)
        self.frame.pack(pady=70)

        Label(self.frame, text='Selecione um tema:').pack()

        # Configura a lista dos temas através do widget OptionMenu
        tema_menu_frame = ttk.Frame(self.frame)
        tema_menu_frame.pack(pady=10)

        tema_menu = ttk.OptionMenu(
            tema_menu_frame, self.tema_selecionado, self.temas[0], *self.temas)
        tema_menu.pack(side=LEFT)

        Button(self.frame, text='Iniciar Jogo',
               command=self.iniciar_jogo).pack(pady=10)

        self.help_button = Button(self.frame, text='?', width=2)
        self.help_button.pack(side=BOTTOM)
        self.help_button.bind('<Enter>', self.exibir_dica)
        self.help_button.bind('<Leave>', self.fechar_dica)

    def iniciar_jogo(self):
        # Limpa a tela anterior
        self.frame.destroy()

        tema = self.tema_selecionado.get()
        self.carregar_palavras(tema)

        self.lista_letras = list(self.palavra)
        self.lista_traco = ['[_]' if letra.isalpha(
        ) else letra for letra in self.lista_letras]
        self.lista_erro = []
        self.digito = []

        self.criar_tela_jogo()

    def carregar_palavras(self, tema):
        try:
            with open(f'temas/{tema}.txt', 'r', encoding='utf-8') as arquivo:
                linhas = arquivo.readlines()
                palavras = [unicodedata.normalize('NFKD', linha).encode(
                    'ASCII', 'ignore').decode('UTF-8') for linha in linhas]
            palavras = [palavra.strip().upper() for palavra in palavras]
            self.palavra = random.choice(palavras)
        except FileNotFoundError:
            print(f'Arquivo {tema}.txt não encontrado.')

    def criar_tela_jogo(self):
        self.canvas = Canvas(self.root, width=200, height=200)
        self.canvas.pack(side=LEFT)

        self.canvas.create_line(80, 185, 80, 20, width=2)  # Barra vertical
        self.canvas.create_line(80, 20, 180, 20, width=2)  # Barra horizontal
        self.canvas.create_line(120, 20, 120, 50, width=2)  # Corda

        self.canvas1 = Frame(self.root)
        self.canvas1.pack()

        Label(self.canvas1, text='\nLetra ou Palavra').pack()
        self.nom = Entry(self.canvas1)
        self.nom.focus_force()
        self.nom.pack()
        self.nom.bind('<Return>', self.forca)
        self.msg = Label(self.root, text=' '.join(self.lista_traco))
        self.msg.pack()

        Label(self.canvas1, text='\nLetras Erradas: ').pack()
        self.msg2 = Label(self.root, text='')
        self.msg2.pack()
        self.msg3 = Label(self.root, text='Tentativas Restantes: 10')
        self.msg3.pack()

    def forca(self, event):
        # Função chamada quando uma letra ou palavra é digitada
        user_input = self.nom.get().upper()
        self.nom.delete(0, 'end')

        if len(user_input) == 1 and user_input.isalpha():
            # Trata a entrada do usuário com "unicodedata" para tornar letras acentuadas ou não equivalentes
            letra = unicodedata.normalize('NFKD', user_input).encode(
                'ASCII', 'ignore').decode('UTF-8')
            if letra in self.lista_letras:
                for i, l in enumerate(self.lista_letras):
                    if l == letra:
                        self.lista_traco[i] = letra
            else:
                if letra not in self.lista_erro:
                    self.lista_erro.append(letra)
                    self.desenhar_boneco(len(self.lista_erro))

        elif len(user_input) > 1:  # Considera o evento de adivinhar a palavra inteira

            if user_input == self.palavra:
                self.lista_traco = list(self.palavra)
            else:
                self.msg.config(text=' '.join(self.lista_traco))
                self.msg2.config(text=' '.join(self.lista_erro))
                self.msg3.config(
                    text=f'Tentativas Restantes: {10 - len(self.lista_erro)}')
                return  # Retorna sem reduzir o número de tentativas, nem armazenar na lista de letras erradas
                '''
                A dinâmica de jogo que desconta tentativas parciais e armazena na lista de letras erradas
                é problemática, porque contabiliza a String dada por completo, e não apenas cada letra
                individualmente.
                Uma funcionalidade que mitiga isso seria fazer uma função que verifica num dicionário se
                a palavra testada existe e, em seguida, se é ou não a resposta correta. Nesse caso,
                caberia outro espaço para listar as palavras erradas, separada das letras.

                # Desconta tentativas parciais e armazena na lista de letras erradas
                if user_input not in self.lista_erro:
                    self.lista_erro.append(user_input)
                    self.desenhar_boneco(len(self.lista_erro))
                '''

        self.msg.config(text=' '.join(self.lista_traco))
        self.msg2.config(text=' '.join(self.lista_erro))
        tentativas_restantes = 10 - len(self.lista_erro)
        self.msg3.config(text=f'Tentativas Restantes: {tentativas_restantes}')

        # Condição que finaliza a rodada em vitória ou derrota
        if all(letra.isalpha() for letra in self.lista_traco):
            self.finalizar_jogo(vitoria=True)
        elif len(self.lista_erro) == 10:
            self.finalizar_jogo(vitoria=False)

    def desenhar_boneco(self, num_erros):
        if num_erros == 1:
            self.canvas.create_oval(100, 50, 140, 90, width=2)  # Cabeça
        elif num_erros == 2:
            self.canvas.create_line(120, 90, 120, 150, width=2)  # Corpo
        elif num_erros == 3:
            self.canvas.create_line(
                120, 100, 80, 140, width=2)  # Braço esquerdo
        elif num_erros == 4:
            self.canvas.create_line(
                120, 100, 160, 140, width=2)  # Braço direito
        elif num_erros == 5:
            self.canvas.create_line(
                120, 150, 86, 190, width=2)  # Perna esquerda
        elif num_erros == 6:
            self.canvas.create_line(
                120, 150, 135, 190, width=2)  # Perna direita
        elif num_erros == 7:
            # Olho esquerdo
            self.canvas.create_line(108, 60, 112, 64, width=2)
            self.canvas.create_line(112, 60, 108, 64, width=2)
            # Olho direito
            self.canvas.create_line(118, 60, 122, 64, width=2)
            self.canvas.create_line(122, 60, 118, 64, width=2)
        elif num_erros == 8:
            self.canvas.create_polygon(
                116, 63, 113, 78, 118, 75, fill='gray')  # Nariz
        elif num_erros == 9:
            self.canvas.create_arc(
                110, 75, 122, 86, start=150, extent=140, width=2)  # Boca

    def finalizar_jogo(self, vitoria):
        self.canvas.destroy()
        self.canvas1.destroy()
        self.msg.destroy()
        self.msg2.destroy()
        self.msg3.destroy()
        self.frame = Frame(self.root)
        self.frame.pack(pady=50)

        resultado = 'Parabéns! Você venceu!' if vitoria else 'Você perdeu!'
        cor_fg = 'green' if vitoria else 'red'
        cor_bg = 'lightgray'
        Label(self.root, text=resultado, fg=cor_fg, bg=cor_bg,
              font=('Arial', 18, 'bold')).pack(pady=10)

        if not vitoria:
            Label(self.root, text=f'A palavra era: {self.palavra}', fg='black', font=(
                'Arial', 12, 'italic')).pack(pady=10)

        Button(self.root, text='Jogar Novamente',
               command=self.reiniciar_jogo).pack(pady=10)

    def reiniciar_jogo(self):
        self.palavra = ''
        self.lista_letras = []
        self.lista_traco = []
        self.lista_erro = []
        self.digito = []

        for widget in self.root.winfo_children():
            widget.destroy()

        self.tela_apresentacao()

    # Gera uma mensagem flutuante e dinâmica ao passar o cursor sobre o botão de ajuda
    def exibir_dica(self, event):
        x, y, _, _ = self.help_button.bbox()
        # Posição relativa à janela raiz
        x += self.root.winfo_rootx() + self.help_button.winfo_width()
        y += self.root.winfo_rooty() + self.help_button.winfo_height()

        self.dica_window = Toplevel(self.root)
        # Remove as decorações da janela para parecer flutuante
        self.dica_window.wm_overrideredirect(True)
        self.dica_window.wm_geometry(f"+{x}+{y}")
        self.dica_window.configure(background='light yellow')

        Label(self.dica_window, text="Digite uma letra ou palavra para adivinhar a palavra secreta.",
              background='light yellow', foreground='blue').pack()
        Label(self.dica_window, text="Palavras parciais não são aceitas. Se a palavra testada for a correta, o jogador vence.",
              background='light yellow', foreground='blue').pack()
        Label(self.dica_window, text="Caso contrário, o número de tentativas não reduzirá.",
              background='light yellow', foreground='blue').pack()
        Label(self.dica_window, text="Você tem 10 tentativas para acertar a palavra. Caso erre 10 vezes, o boneco será enforcado.",
              background='light yellow', foreground='blue').pack()
        Label(self.dica_window, text="Boa sorte!",
              background='light yellow', foreground='blue').pack()

    def fechar_dica(self, event):
        if self.dica_window:
            self.dica_window.destroy()


root = Tk()
Jogo(root)
root.mainloop()
